import React from 'react';
import {Card} from 'react-bootstrap';
import axios from 'axios';

const Home = () =>{
    axios.get('http://localhost:8000/api/Equipos/')
        .then((response) => {
            console.log("ha entrado en axios");
            console.log(response.Equipo);
            console.log(response.Jugadores);
            console.log(response.EdadMedia);
            console.log(response.ValorTotal);
            console.log(response.ValorMedio);
            console.log(response.Actualizacion);
        });
  

    const cardInfo = [
        
        {
            image: "./public/images/1.png",
            title:"Test0",
            text: "0€"
        },
        {
            image: "https://www.google.com/search?q=betis+png&sxsrf=ALeKk039eUTdCd3C_AxSgyZeipjTyV4g1w:1616082413986&source=lnms&tbm=isch&sa=X&ved=2ahUKEwjWhdqRmLrvAhVRiFwKHcCAD14Q_AUoAXoECBUQAw&biw=958&bih=999#imgrc=-O7XpGO6P3lyiM",
            title:"Test1",
            text: "1€"
        },
        {
            image: "https://www.google.com/search?q=levante+png&tbm=isch&ved=2ahUKEwiXxKGSmLrvAhUINBoKHZxzApsQ2-cCegQIABAA&oq=levante+png&gs_lcp=CgNpbWcQAzICCAAyAggAMgYIABAHEB4yBggAEAcQHjIGCAAQBxAeMgYIABAHEB4yBggAEAcQHjIGCAAQBxAeMgYIABAHEB4yBggAEAcQHjoECAAQQzoHCAAQsQMQQzoFCAAQsQNQmJwBWKa7AWC2vAFoAHAAeACAAWiIAfEFkgEDNy4ymAEAoAEBqgELZ3dzLXdpei1pbWfAAQE&sclient=img&ei=73VTYNeQCYjoaJznidgJ&bih=999&biw=958#imgrc=DaZKJh223KiHnM", 
            title:"Test2", 
            text: "2€"},
        {
            image: "https://www.google.com/search?q=valencia+png&tbm=isch&ved=2ahUKEwj7hKOemLrvAhWXgM4BHduAD_gQ2-cCegQIABAA&oq=valencia+png&gs_lcp=CgNpbWcQAzICCAAyAggAMgYIABAHEB4yBggAEAcQHjIGCAAQBxAeMgYIABAHEB4yBggAEAcQHjIGCAAQBxAeMgYIABAHEB4yBggAEAcQHjoECAAQQzoECAAQEzoICAAQBxAeEBNQ22ZY2m9giXJoAHAAeACAAWmIAckFkgEDOC4xmAEAoAEBqgELZ3dzLXdpei1pbWfAAQE&sclient=img&ei=CHZTYPvgFJeBur4P24G-wA8&bih=999&biw=958#imgrc=pOAKqX6f5pE3RM", 
            title:"Test3", 
            text: "3€"
        },
    ];

    const renderCard = (card, index) => {
        return(
            <React.Fragment>
                <Card style={{width: "18rem"}}>
                    <Card.Img variant="top" src="holder.js/100px180" src={card.image}/>
                </Card>
                <Card.Body>
                    <Card.Title>{card.title}</Card.Title>
                    <Card.Text>{card.text}</Card.Text>
                </Card.Body>
            </React.Fragment>            
        );
    }       

    return(
        <section class="row mt-5">
            <div class="col-3">
                {cardInfo.map(renderCard)}
            </div>
            <div class="col-3">
                {cardInfo.map(renderCard)}
            </div>
            <div class="col-3">
                
            </div>
            <div class="col-3">
                
            </div>
        </section>
    );
}

export default Home;
